import React from "react";
import Navbar from './Components/Navbar';
import Home from './Pages/Home';  // Assuming you have a Home.js in the Pages directory.
import Comments from './Components/'; // Assuming you have structured your comments in a Comments.js page.
import Profile from '../src/Components/UserProfile';
import "./App.css";
import { Auth } from "./Components/Auth";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Auth />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/comments" element={<Comments />} />
          <Route path="/profile" element={<Profile />} />
          {/* Add other routes as needed */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
